@loes_moes Even checken of het wel "echte" twitteraars of trol accounts met enkele volgers.
Er zijn veel linkse trollen die alleen brand roepen maar zelf ook niet weten waarom ze dat roepen. Ze hebben nog geen rook gezien maar "iemand riep brand dus ik ook"...
Reageren is dan erg lastig

Morgen spelen we de 1e bekerwedstrijd thuis tegen vv IJVV JO19-1 uit Ijsselmuiden.
Aanvang 14.45 uur op  sportpark @DeLaene 
@ijvvdenuithoek

@viaplaysportnl Ik denk dat we het maar eens over compensatie moeten gaan hebben.

Elke race, elke stream zijn er problemen met verbinding, beeld, geluid etc.
Dat kan na 8 maanden geen incidentje meer genoemd worden, maar is een structureel probleem.
